    var getHeight = function () {
        var arrHeight = [];
        if($('.rate-fee table') !== undefined) {
            $('.rate-fee table').each(function (idx) {
                if (!arrHeight[idx]) {
                    arrHeight[idx] = [];
                }
                $(this).find('tr').removeAttr('style').each(function () {
                    arrHeight[idx].push($(this).height());
                });
            });
            return arrHeight;
        }
    };

    var determineHeight = function () {
        var hs = getHeight();
        var nA;
        $.each(hs, function (idx, $this) {
            if (!nA) {
                nA = new Array($this.length);
            }
            $.each($this, function (idxx, $$this) {
                if (!nA[idxx]) {
                    nA[idxx] = 0;
                }
                if (nA[idxx] < $$this) {
                    nA[idxx] = $$this;
                }
            });
        });
        return nA;
    };

    determineHeight();

