    var applyCurrentState = function () {
        if ($('[data-section]').length > 0 && $(window).width() > 991) {
            var firstSectionTop = $('[data-section]').first().offset().top - 88,
                lastSectionBot = $('[data-section]').last().offset().top;
            $('[data-section]').each(function (i) {
                var anchor = $('[data-menu=' + $(this).attr('data-section') + ']').find('a'),
                    sectionTop = $(this).offset().top - 140,
                    sectionBottom = sectionTop + $(this).outerHeight();
                    moveTo = parseInt(anchor.closest('[data-menu]').index());
                if ($(window).scrollTop() >= sectionTop && $(window).scrollTop() < sectionBottom) {
                    anchor.addClass('active');
                    if($('ul.has-carousel').hasClass('slick-initialized') && ($(window).width() > 991)){
                      $('ul.has-carousel').slick('slickGoTo', moveTo);
                    }
                }
                else {
                    if ($(window).scrollTop() < firstSectionTop) {
                        return false;
                    }
                    if ($(window).scrollTop() >= lastSectionBot) {
                        return false;
                    }
                    anchor.removeClass('active');
                }
            });
        }
    };

