    var activateIndex = function (index, margin1, margin2) {
        if ($(this).scrollTop() > $('.banner-wrap').outerHeight() + 179) {
            index.addClass('sticky');
        } else {
            index.removeClass('sticky');
        }

        var footerSection = $('#footer').offset().top - 270;
        if ($(window).scrollTop() >= footerSection) {
            index.addClass('stick-bottom-index');
            index.removeClass('sticky');
        } else {
            index.removeClass('stick-bottom-index');
        }

        var firstEntryTop = $('[data-entry]').first().offset().top - margin1,
            lastEntryBot = $('[data-entry]').last().offset().top;
        $('[data-entry]').each(function (i) {
            var currSectionTop = $(this).offset().top - margin2;
            var currSectionBot = currSectionTop + $(this).outerHeight();
            var indexLink = $('[data-index="' + $(this).attr('data-entry') + '"]');

            if ($(window).scrollTop() >= currSectionTop
                && $(window).scrollTop() < currSectionBot) {
                $('[data-section-index] [data-index]').removeClass("active");
                indexLink.addClass("active");
            } else if ($(window).scrollTop() < firstEntryTop) {
                $('[data-section-index] [data-index]').addClass("active");
            }
        });
    }

