    var updateValueBubble = function (pos, value, context) {
        pos = pos || context.position;
        value = value || context.value;
        var $valueBubble = $('.rangeslider-tooltip', context.$range);

        if ($valueBubble.length) {
            $valueBubble[0].style.left = $('.rangeslider__handle').position().left + 'px';
            $valueBubble[0].innerHTML = addCommas(value.toString()) + ' ' + sliderUnit;
        }
    }


    var rangeCalculator = function (minVal, maxVal, callback) {
        var sliderRange = $("#slider-range");

        function initRangeSlider() {
            sliderRange.slider({
                range: true,
                min: minVal || 1000,
                max: maxVal || 10000,
                values: [minVal || 1000, maxVal || 10000],
                slide: function (event, ui) {
                    $("#amount-left").val(addCommas(ui.values[0]) + " points");
                    $("#amount-right").val(addCommas(ui.values[1]) + " points");
                }
            });
            if (callback) {
                sliderRange.on("slidechange", callback);
            }
            $("#amount-left").val(addCommas(sliderRange.slider("values", 0)) + " points");
            $("#amount-right").val(addCommas(sliderRange.slider("values", 1)) + " points");
        }

        if (sliderRange.hasClass('ui-slider')) {
            sliderRange.slider("destroy");
            initRangeSlider();
        } else {
            initRangeSlider();
        }
    };
